CREATE TYPE SESSO AS ENUM ('M', 'F');
CREATE TYPE RUOLO AS ENUM ('p', 'mb', 'ms', 'f', 'ssp', 'ssn');

CREATE TABLE PROVINCIA (
    Id CHAR(2) PRIMARY KEY,
    Nome VARCHAR(200) NOT NULL
);

CREATE TABLE VISITA (
    Id SERIAL PRIMARY KEY,
    Nome VARCHAR(200)
);

CREATE TABLE UTENTE(
	Id SERIAL PRIMARY KEY,
	Email VARCHAR(100) NOT NULL UNIQUE,
	Password BYTEA NOT NULL,
	Salt BIGINT,
	IdProvincia CHAR(2) REFERENCES PROVINCIA,
    Ruolo RUOLO NOT NULL,
    Nome VARCHAR(50),
	Cognome VARCHAR(50),
	Sesso SESSO,
	DataNascita DATE,
	LuogoNascita VARCHAR(100),
	CodiceFiscale CHAR(16) UNIQUE,
	MedicoBase BIGINT REFERENCES UTENTE
);

CREATE TABLE FARMACO(
    Id SERIAL PRIMARY KEY,
    Nome VARCHAR(100) NOT NULL,
    Descrizione TEXT,
    Prezzo DOUBLE PRECISION NOT NULL
);

CREATE TABLE RICETTA(
    Id SERIAL PRIMARY KEY,
    Farmaco BIGINT REFERENCES FARMACO,
    MedicoBase BIGINT REFERENCES UTENTE,
    Paziente BIGINT REFERENCES UTENTE,
    Farmacia BIGINT REFERENCES UTENTE,
    Emissione TIMESTAMP NOT NULL DEFAULT NOW(),
    Evasione TIMESTAMP
);

CREATE TABLE ESAME(
    Id SERIAL PRIMARY KEY,
    Nome VARCHAR(200) NOT NULL,
    Descrizione TEXT
);

CREATE TABLE ESAME_PRESCRITTO(
    Id SERIAL PRIMARY KEY,
    Esame BIGINT REFERENCES ESAME,
    MedicoBase BIGINT REFERENCES UTENTE,
    Paziente BIGINT REFERENCES UTENTE,
    Prescrizione TIMESTAMP NOT NULL DEFAULT NOW(),
    Erogazione TIMESTAMP,
    Esito TEXT
);

CREATE TABLE FOTO(
    Id SERIAL PRIMARY KEY,
    Caricamento TIMESTAMP NOT NULL,
    Paziente BIGINT REFERENCES UTENTE
);

CREATE TABLE VISITA_BASE(
    Id SERIAL PRIMARY KEY,
    MedicoBase BIGINT REFERENCES UTENTE,
    Paziente BIGINT REFERENCES UTENTE,
    Erogazione TIMESTAMP NOT NULL DEFAULT NOW(),
    Anamnesi TEXT
);

CREATE TABLE VISITA_SPECIALISTA(
    Id SERIAL PRIMARY KEY,
    MedicoSpecialista BIGINT REFERENCES UTENTE,
    MedicoBase BIGINT REFERENCES UTENTE,
    Paziente BIGINT REFERENCES UTENTE,
    Visita BIGINT REFERENCES VISITA,
    Prescrizione TIMESTAMP NOT NULL DEFAULT NOW(),
    Erogazione TIMESTAMP,
    Anamnesi TEXT
);

CREATE TABLE TOKEN_REMEMBER_ME(
    Token BYTEA PRIMARY KEY,
    IdUtente BIGINT REFERENCES UTENTE NOT NULL,
    LastEdit TIMESTAMP NOT NULL DEFAULT NOW()
);

CREATE TABLE TOKEN_PSW(
    Token BYTEA PRIMARY KEY,
    IdUtente BIGINT REFERENCES UTENTE NOT NULL,
    LastEdit TIMESTAMP NOT NULL DEFAULT NOW()
);







